-- Drop table

-- DROP TABLE episode.cirelationmap;

CREATE TABLE episode.cirelationmap (
	id int4 NOT NULL,
	org_id varchar(20) NOT NULL,
	sourceclass varchar(100) NOT NULL,
	targetclass varchar(100) NOT NULL,
	relationname varchar(20) NOT NULL,
	create_dt timestamp NOT NULL DEFAULT timezone('utc'::text, CURRENT_TIMESTAMP),
	create_id varchar(20) NOT NULL,
	update_dt timestamp NOT NULL DEFAULT timezone('utc'::text, CURRENT_TIMESTAMP),
	update_id varchar(20) NOT NULL,
	CONSTRAINT cirelationmap_idx1 PRIMARY KEY (id),
	CONSTRAINT cirelationmap_idx2 UNIQUE (org_id, sourceclass, targetclass, relationname)
);
CREATE INDEX cirelationmap_idx3 ON episode.cirelationmap USING btree (org_id, sourceclass);
CREATE INDEX cirelationmap_idx4 ON episode.cirelationmap USING btree (org_id, targetclass);

-- Permissions

ALTER TABLE episode.cirelationmap OWNER TO episode;
GRANT ALL ON TABLE episode.cirelationmap TO episode;

